import "./App.css";
import React, { Component, Fragment } from "react";
import Navbar from "./components/layout/Navbar";

class App extends Component {
  render() {
    const name = "Simon";
    const loading = false;

    return (
      <Fragment>
        {loading ? <h1>Loading</h1> : <h1>Hello {name}</h1>}
        </Fragment>
    );
  }
}

export default App;
